{% extends '/Layouts/layout2.html.twig' %}

{% block title %} Liste des produits en magasin {% endblock %}


{% block body %}
       <table>
        <tr>
            <th>login</th>
            <th>mot de passe</th>
            <th>nom</th>
            <th>prenom</th>
            <th>date de naissance</th>
            <th>Statut</th>
            <th>action</th>
        </tr>
     {% for utilisateur in  utilisateurs %}        
        <tr>
            <td>{{ utilisateur.login}}</td>
            <td>{{ utilisateur.motDePasse }}</td>
            <td>{{ utilisateur.nom }}</td>
            <td>{{ utilisateur.prenom }}</td>
            <td>{{ utilisateur.anniversaire|date(\"d/M/Y\") }}</td>
            {% if utilisateur.isAdmin %}
            <td> Administrateur </td>
            {% else %}
            <td>Client</td>
            {% endif %}
             <td> <button type=\"button\" value=\"Supprimer\">  <a href = {{ path('supprimer_utilisateur',{id: utilisateur.id }) }} /> 
             suppimer
             </button> </td>

        </tr>
        
     {% endfor %}
        <table>
{% endblock %}", "utilisateur/list.html.twig", "C:\\wamp64\\www\\Projet-Web\\templates\\utilisateur\\list.html.twig");
